'use strict';
//@@DocBrief("The class provides access to margin requirements information")
//@@DocInclude
class MarginRequirements {
    mmr;
    lmr;
    emr;
    constructor() {
        this.mmr = 0.0;
        this.lmr = 0.0;
        this.emr = 0.0;
    }
    getMMR() {
        return this.mmr;
    }
    getLMR() {
        return this.lmr;
    }
    getEMR() {
        return this.emr;
    }
}
module.exports = MarginRequirements
